INSERT INTO `watch_board` VALUES (2,'꼭 입어야할 후드티 4가지 가져왔다..! /후드티 추천!','코디메이커피로','<iframe width=\"100%\" height=\"100%\" src=\"https://www.youtube.com/embed/DgBLN5rrPRI\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>','스투시','반갑습니다 구독자여러분들 저는 코디메이커 피로입니다\r\n이번에는 진짜 저만 알고싶었지만..\r\n이렇게 영상으로 만들어본! 후드티 추천영상!\r\n다양한 브랜드의 후드티들을 가져왔으니, 이번 영상도 재미있게 봐주시면 감사하겠습니다\r\n\r\n스투시/마우이앤선즈/포스333/예스아이씨\r\n','2022-03-07 03:36:24','2022-03-10 11:32:58',27,'Y'),(3,'샤넬 클래식백 리뷰 ? | 샤넬의 걸작 클래식백 미듐 ?| 관리법 |Chanel classic bag review | 명품백 |','라비앙르미에','<iframe width=\"100%\" height=\"100%\" src=\"https://www.youtube.com/embed/BmVKy2dyayQ\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>','샤넬','* 렌트를 통해 리뷰한 제품입니다.\r\n\r\ncontact\r\nlavienlumiere@gmail.com','2022-03-07 05:51:31','2022-03-08 03:33:39',32,'Y'),(4,'디올 바비백 스몰 리뷰? | 디올백추천 | 예쁜 룩북과 함께 봐요? | 명품백 | 디올가방 | Dior bobby bag review small size','라비앙르미에','<iframe width=\"100%\" height=\"100%\" src=\"https://www.youtube.com/embed/LeoGhBmX8pg\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>','디올','* 렌트를 통해 리뷰한 제품입니다.\r\n\r\nContact?\r\nlavienlumiere@gmail.com\r\nInstagram?\r\n@lavien__lumiere\r\n\r\n?\r\nLook book . 1\r\n상의 - 토피넛 폴라 T\r\n하의 - 하운드투스 펜슬 스커트\r\n*모두 \'더 제이수\'제품입니다.\r\n?\r\nLook book . 2\r\n상의 - 더 제이수 / 핏 폴라 니트\r\n하의 - 렌느 / FW아르켓와이드슬랙스\r\n아우터 - 렌느 / 헤링헨드메이드코트\r\n?\r\nLook book . 3\r\n상의 -Roll Up / 셔링 벨벳 입술티 (현재 판매상품이 아닙니다)\r\n하의 - 울 헤링본 H 스커트\r\n?\r\n악세서리\r\n목걸이 - 루이비통 에센셜 V 네크리스\r\n벨트 - 루이비통 LV 아이코닉 리버서블 벨트\r\n팔찌 - 펜디 F IS FENDI 브레이슬릿\r\n\r\n안녕하세요. 라비앙르미에입니다.\r\n오늘 리뷰할 제품은 디올의 바비백 스몰입니다\r\n\r\n바비백은 세련된 라인과 조화로운 비율이 돋보이는 호보 스타일의 가방입니다.\r\n총 4가지 사이즈가 있는데\r\n지금 보시는 스몰 사이즈를 포함해 미디엄 라지 \r\n그리고 이번 시즌 새로나온 이스트 웨스트 (East west) 가 있습니다.\r\n바비백 스몰의 가격은 420만원입니다\r\n\r\n전체적인 디자인을 보시면 \r\n블랙 컬러의 복스 송아지 가죽 소재로 제작되었습니다.\r\n소가죽 특유의 무늬가 없이 민무늬에 광택감과 윤기가 흐르는 부드러운 소재의 가죽이고 흐물거리지 않으면서 탄탄한 재질이에요.\r\n심플한 듯 보이지만 반짝이는 골드 하드웨어의 장식들이 있어서 고급스러운 분위기가 느껴집니다.\r\n일반적인 스퀘어 쉐입의 가방들과 달리 호보백 스타일이라 라운드져있어서 캐주얼하면서 트렌디한 디자인이에요.\r\n\r\n앞면 플랩을 보시면 CD 골드 장식과 버클이 달려있는 스트랩 장식이 있습니다.  \r\n이 스트랩으로 오픈 클로징을 하는 건 아니고 마그네틱 형식으로 오픈 클로징을 하는 방식입니다.\r\n플랩 밑에 자석 잠금장치가 부착되어 있습니다.\r\n\r\n가방의 스트랩은 탈부착이 가능하고 스트랩 고리가 스페셜하게 디자인이 되어있어요.\r\n이런 디테일들이 디올만의 엘레강스한 무드가 잘 느껴져서 좋은 거 같습니다.\r\n길이 조절도 가능하고 밀리터리 형식의 버클이 크리스찬 디올 로고가 각인되어 있습니다.\r\n스트랩의 길이 조절이 가능해서 숄더백 , 크로스백 모두 가능합니다.\r\n뒷면은 30몽테인의 엠보싱 로고가 있고 포켓이 있습니다.\r\n이 바비백의 모든 골드 소재들은 광택감이 느껴지는 딥한 골드 컬러에 스크래치에 약하지 않아  굉장히 고급스러워요..\r\n\r\n가방이 스몰사이즈라 수납이 많이 되는 편은 아닙니다.\r\n수납력이 어느 정도 되는지 잠깐 보여드리겠습니다.\r\n\r\n바비백은 블랙컬러 말고도 다양한 컬러가 있습니다.\r\n사이즈가 미니사이즈여서 그런지 작은 크기에서 느껴지는 귀여움과 캐주얼한 느낌을 줄 수 있는 트렌디한 디자인 그리고 고급스러운 복스 가죽이 너무 예쁜 가방이에요.\r\n이제 이 가방과 어울리는 룩북을 보여드리겠습니다.\r\n\r\n잘 보셨나요~? \r\n오늘 리뷰는 여기서 마치겠습니다.\r\n더 궁금하신 점은 댓글 남겨주세요.\r\n\r\n리뷰가 도움이 되셨다면 좋아요 구독 버튼 눌러주세요.\r\n다음에도 예쁜 제품들과 함께 만나 뵙겠습니다.\r\n\r\n감사합니다❤️','2022-03-07 05:53:21','2022-03-07 05:53:58',9,'Y'),(5,'? 명품가방 코디룩북 ? | 디올 레이디백 | 샤넬 보이백 | 루이비통 록키BB 베리토트 V토트 | 결혼식하객패션 하객룩 데일리룩 오피스룩 데일리룩 명품백코디 모임룩 여성코디',' 라비앙르미에','<iframe width=\"100%\" height=\"100%\" src=\"https://www.youtube.com/embed/M21J2Uj85Do\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>','샤넬','안녕하세요~?\r\n라비앙 르미에 입니다.\r\n이번 영상은\r\n명품백 5개와 어울리는 코디룩북 영상을 제작해봤어요~^^*\r\n편하게 감상해주세요~? \r\n\r\n비즈니스 \r\nlavienlumiere@gmail.com\r\n\r\n모델\r\n\r\nheight /160\r\nweight / 47 \r\n?\r\nc.1\r\n렌느 | 엘레나원피스\r\nc.2\r\n더로랑 | 실크 셔츠 원피스 \r\nc.3\r\n실크 셔츠 아이보리 \r\n더 제이수 | 헤링본 트임 스커트 \r\nc.4 \r\n아띠랑벨르 | 실크 투피스 ( 상의만 착용)\r\n더 로랑 | 파리 로얄 스커트\r\nc.5\r\n더 제이수 | 실크 블라우스 (블루)\r\n엘로렌 | gorgepus 실키 스커트\r\nc.6\r\n벨르아 | 반목 민소매 골지 니트티\r\n스커트 | 개인소장품\r